import React from 'react';

function Universe() {
    return ( 
        <div className='container text-center mt-5' style={{color:"#424242"}}>
          <div className='row'>
            <p style={{fontSize:"1.1rem"}}>Want to know more about our technology stack? Check out the Zerodha.tech blog.</p>
            <h1 className='mt-5' style={{fontSize:"1.7rem"}}>The Zerodha Universe</h1>
            <p className='mt-2'>Extend your trading and investment experience even further with our partner platforms</p>
          </div>
          <div className='row pl-5 pr-5 pt-0 pb-0'>
            <img src='/media/images/smallcase-logo.png' alt="smallcase" style={{height:"50px",width:"22%"}}></img>
            <img src='/media/images/streak-logo.png' alt="streak" style={{height:"50px",width:"22%"}}></img>
            <img src='/media/images/sensibull-logo.svg' alt="sensibull" style={{height:"50px",width:"22%"}}></img>
          </div>

        </div>
     );
}

export default Universe;
